description:
Well this is my collection of Iron Maiden, one of the greatest HM bands ever.
I've collected all this since I'm a fan of IM.
Endless days of buying, ripping, downloading...

Here are all studio , compilations and live albums.
All info is collected from IM official website few years ago.
Recent albums info (from 2008 and onwards) are from wiki.


Album covers are in ID3 Tag. All covers are in sizes between 800px and 1500 I think.


